  false,\n\t\"url\": null,\n\t\"notes\": \"The proposed project is a part of the Refuge
  invasive species management program and will help achieve goals and priority habitats
  identified in the Refuge CCP. The project will conduct ED/RR surveys over 1,500
  acres focusing on known species occurrences and those on the southwest Washington/Willamette
  Valley watch lists. Control will be focused primarily on those species which currently
  pose the greatest challenges or are not yet under desired levels of control: Ricefield
  bulrush, shiny geranium, yellow flag iris, slenderflower thistle, water primrose
  willow, fragrant water lily, and poison hemlock. Other target species will be treated
  as opportunity or time permits. All funds would be obligated in FY 15. Most (83%)
  of the work will take place in FY 15 except for control work on shiny geranium (17
  %) which would take place during the dormant season Nov-March in FY 16 to reduce
  impacts to non-target species.\",\n\t\"license_title\": \"License Not Specified\",\n\t\"extras\":
